package problemasU4;

public class Ej2 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		int a=320;
		while (a>=160) {
			if (a%20==0) {
				System.out.println(a);
			}a--;
		}
		
		int b=320;
		do {
			if(b%20==0) {
				System.out.println(b);
			}b--;
		}while(b>=160);
		
		for(int c=320;c>=160;c--) {
			
			if(c%20==0) {
				System.out.println(c);
			}
		}
		
		
		
		
		
		
	}

}
